import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { ShoppingCart, Home, Menu as MenuIcon, Map, User } from 'lucide-react';
import SearchBar from './SearchBar';
import MenuPage from '..pages/MenuPage';

const Header = ({ cartItemsCount, onSearch, user, onLogout }) => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <header className="bg-green-600 text-white p-4 shadow-md">
      <div className="container mx-auto flex flex-wrap justify-between items-center">
        <Link to="/" className="text-2xl font-bold">Curry</Link>
        
        <button
          className="lg:hidden"
          onClick={() => setIsMenuOpen(!isMenuOpen)}
          aria-label="Toggle menu"
        >
          <MenuIcon size={24} />
        </button>

        <nav className={`${isMenuOpen ? 'block' : 'hidden'} lg:block w-full lg:w-auto mt-4 lg:mt-0`}>
          <ul className="flex flex-col lg:flex-row space-y-2 lg:space-y-0 lg:space-x-4">
            <li><Link to="/" className="flex items-center hover:text-green-200"><Home className="mr-1" size={18} /> Home</Link></li>
            <li><Link to="/menu" className="flex items-center hover:text-green-200"><MenuIcon className="mr-1" size={18} /> Menu</Link></li>
            <li><Link to="/order" className="flex items-center hover:text-green-200"><ShoppingCart className="mr-1" size={18} /> Order</Link></li>
            <li><Link to="/track" className="flex items-center hover:text-green-200"><Map className="mr-1" size={18} /> Track</Link></li>
            {user ? (
              <>
                <li><Link to="/profile" className="flex items-center hover:text-green-200"><User className="mr-1" size={18} /> Profile</Link></li>
                <li><button onClick={onLogout} className="hover:text-green-200">Logout</button></li>
                {user.isAdmin && (
                  <li><Link to="/admin" className="flex items-center hover:text-green-200"><User className="mr-1" size={18} /> Admin</Link></li>
                )}
              </>
            ) : (
              <li><Link to="/login" className="flex items-center hover:text-green-200"><User className="mr-1" size={18} /> Login</Link></li>
            )}
          </ul>
        </nav>

        <div className="w-full lg:w-auto mt-4 lg:mt-0">
          <SearchBar onSearch={onSearch} />
        </div>

        <Link to="/cart" className="flex items-center mt-4 lg:mt-0 hover:text-green-200">
          <ShoppingCart className="mr-1" size={18} />
          <span className="bg-white text-green-600 rounded-full px-2 py-1 text-xs font-bold">
            {cartItemsCount}
          </span>
        </Link>
      </div>
    </header>
  );
};

export default Header;
